wiki_summary:
“Double Bass” is the ninth track on Gorillaz’s self titled debut album, featuring only one line, read by Damon Albarn. It was originally thought to be fictional bassist Murdoc Niccals stating the line, but was confirmed to be Albarn in the Gorillaz autobiography, Rise of the Ogre.

The band’s virtual drummer, Russel Hobbs, also states something interesting about the song in Rise of the Ogre;

“I’d bought this little great thing, a tiny microphone with a suckerpad on the end from Tandy, the electrical store. <a href="http://www.last.fm/music/Gorillaz/_/Double+Bass">Read more on Last.fm</a>.
